import React, { useEffect } from 'react';
import axios from "axios";

function App() {
  const [isLogged, setIsLogged] = useState(false);

  useEffect(() => {
    axios.post(process.env.REACT_APP_API_URL + "users/auth", {token: localStorage.token})
        .then((res) => {
          setIsLogged = res.status === 200 ? true : false;
        })
  })

  return (
    <div className="App">
      <Router>

      </Router>
    </div>
  );
}

export default App;
